Abantu abaningi okungenani kanye sibhekene nezinkinga ezihlobene kwamazinyo, futhi unesifiso uphinde uthole ukumamatheka yakhe yangaphambili. Modern nekhwalithi ezibhekwa ephathelene nokufakelwa kwamazinyo. Izinzuzo nezingozi nebubi - agumenti sina ukuthi kudingeka acabangisise futhi ucabangele ukuthi ukuhlola bona umphumela leli su emangalisayo.
