oli, ngakho-ke has Izimo yayo futhi izinkomba.
Le nqubo akunakwenzeka ebukhoneni izifo ezithize ezingamahlalakhona. Ngokwesibonelo, njenge:
- rheumatism;
- sikashukela;
- yezifo ngalo ingaphakathi ngomlomo;
- izifo bone;
- kwezinso of the ephakathi kanye neuropathy isimiso sezinzwa;
- neoplasms ebulalayo.
