Isiguli ngasinye kumele bakuqonde ukuthi ngaphambi inqubo udinga ukucela hhayi kuphela ukuthi yini ephathelene nokufakelwa kwamazinyo, njengoba eziyiyo, yiziphi pluses kanye minuses kule nqubo abaphelele futhi ongenasici. Kubalulekile futhi ukucacisa neziqu onguchwepheshe ngubani siyofeza manipulation.
